/* NAVBAR - INDEX.JS */

import React from 'react';
import { NavLink } from '@duik/it'

import './style.css';

export default function NavBar() {
    return (
        <div className="navbar">
            <ul>
                <li>
                    <NavLink className="active" to="upload" pill>
                        Upload
                    </NavLink>
                </li>
                <li>
                    <NavLink to="files" pill>
                        Files
                    </NavLink>
                </li>
            </ul>
        </div>
    )
}
